                                    />
                                  )}
                                </TableCell>
                              ) : (
                                <TableCell key={defIndex} width={row[column?.width]}>
                                  {column?.type !== 'checkbox' && column?.type !== 'copyIcon' && (
                                    <Typography className={classes.tableCellLabel} style={{ width: `${row[column?.width]}` }}>
                                      {row[column?.id] || '-'}
                                    </Typography>
                                  )}
                                  {column?.type === 'copyIcon' && (
                                    <Button
                                      icon={FileCopyIcon}
                                      size="medium"
                                      variant="text"
                                      color="default"
